import time
start_time = time.time()

alphabet = ['a', 'b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j', 'k', 'l', 'm', 'n', 'o', 'p', 'q', 'r', 's', 't', 'u', 'v', 'w', 'x', 'y', 'z']

text = ""

def isUnit(string):
    if (string[0].islower() and string[1].isupper()):
        return string[0] == string[1].lower()
    elif (string[0].isupper() and string[1].islower()):
        return string[0] == string[1].upper()
    return False

def notFinished(text):
    for i in range(0, len(text)-1):
        if isUnit(text[i:i+2]):
            return True
    return False

maxreached = 0
count = 0
removed = ""

smallest = len(text)

# This is the weirdest program flow I have ever written

for a in alphabet:
    localtext = text.replace(a, "").replace(a.upper(), "")
    while notFinished(localtext):
        for i in range(maxreached, len(localtext)-1):
            if isUnit(localtext[i:i+2]):
                maxreached = i
                localtext = localtext[:i] + localtext[i+2:]
                break
        if not notFinished(localtext[maxreached:]):
            maxreached = 0
        count += 1
        # print(count, len(localtext), maxreached)
    if (len(localtext) < smallest):
        smallest = len(localtext)
    print("Done with", a, "Smallest:", smallest)

print(smallest)
print("--- %s seconds ---" % (time.time() - start_time))